from typing import List
def removeDuplicates(nums: List[int]) -> int:
    k=len(nums)
    for i in range(0,k-1):
        while nums[i]==nums[i+1] and k-1>i:
            nums.remove(nums[i])
            nums.append(nums[i])
            k-=1
    return k

